			shellPath = /bin/sh;
			shellScript = "#准备相关数据\nAPP_DIR=${BUILD_DIR}/${CONFIGURATION}${EFFECTIVE_PLATFORM_NAME}\nICON3X=${APP_DIR}/$CONTENTS_FOLDER_PATH/\"AppIcon60x60@3x.png\"\nICON2X=${APP_DIR}/$CONTENTS_FOLDER_PATH/\"AppIcon60x60@2x.png\"\nICON_MARK=${APP_DIR}/$CONTENTS_FOLDER_PATH/\"icon_mark.png\"\nPLIST=${APP_DIR}/$CONTENTS_FOLDER_PATH/Info.plist\nPROJ_PLIST=${PROJECT_DIR}/\"VillagePlay/Info.plist\"\n\n#确定编译目录\necho \"ICON3X\" $ICON3X\n\necho \"build dir is $BUILD_DIR/$CONFIGURATION$EFFECTIVE_PLATFORM_NAME\"\n\necho \"PLIST is \" $PLIST\n\necho \"PROJ_PLIST is\" $PROJ_PLIST\n\n\n#确定版本名称 CFBundleDisplayName\nBUNDLE_NAME=`/usr/libexec/PlistBuddy -c \"Print:CFBundleName\" $PLIST`\nBUNDLE_ID=`/usr/libexec/PlistBuddy -c \"Print:CFBundleIdentifier\" $PLIST`\necho BUNDLE_NAME:+${BUNDLE_NAME}\necho BUNDLE_ID:+${BUNDLE_ID}\nDB=\"com.qineng.villageplay.db\"\nif [[ $BUNDLE_ID = $DB ]];then\nDISPLAY_NAME=\"下乡客DEV\"\nelse\nDISPLAY_NAME=\"下乡客\"\nfi\n\n#修改版本名称\n/usr/libexec/PlistBuddy -c \"Set:CFBundleDisplayName $DISPLAY_NAME\" $PLIST\n\n#获取软件编译版本号\nBUILD=`/usr/libexec/PlistBuddy -c \"Print:CFBundleVersion\" $PLIST`\n#获取渠道号\n#CHANNEL=`/usr/libexec/PlistBuddy -c \"Print:Channel\" $PLIST`\n\n#打标记\n#APP=\"APP\"\nAPP=\"DEV\"\nMARK=\"$APP$BUILD\"\nIPHONEOS=\"iphoneos\";\n\n#if [[ $CHANNEL != $APP ]];then\nif [[ $BUNDLE_ID = $DB ]];then\n\n#生成带编译信息的图标\nif [[ $PLATFORM_NAME = $IPHONEOS ]];then\npngcrush -revert-iphone-optimizations -q $ICON3X /tmp/\"Icon.png\";\npngcrush -revert-iphone-optimizations -q $ICON_MARK /tmp/\"icon_mark.png\";\nelse\ncp $ICON3X /tmp/\"Icon.png\";\ncp $ICON_MARK /tmp/\"icon_mark.png\";\nfi\n\n/usr/local/bin/convert -background none -fill green -pointsize 20 -stroke green -strokewidth 0 -rotate 45 label:\"$MARK\" /tmp/\"mark.png\";\n/usr/local/bin/composite -gravity center -geometry +14-14 /tmp/\"mark.png\" /tmp/\"icon_mark.png\" /tmp/\"info_mark.png\"\n/usr/local/bin/composite -gravity northeast -geometry +0-0 /tmp/\"info_mark.png\" /tmp/\"Icon.png\" /tmp/\"new_3xicon.png\";\n/usr/local/bin/convert -resize x120 /tmp/\"new_3xicon.png\" /tmp/\"new_2xicon.png\"\n\necho 替换图标\necho ${PLATFORM_NAME}+${IPHONEOS}\necho ${ICON2X}\n#替换图标\nif [ $PLATFORM_NAME = $IPHONEOS ] ;then\npngcrush -iphone /tmp/\"new_3xicon.png\" $ICON3X;\npngcrush -iphone /tmp/\"new_2xicon.png\" $ICON2X;\nelse\ncp /tmp/\"new_3xicon.png\" $ICON3X;\ncp /tmp/\"new_2xicon.png\" $ICON2X;\nfi\n\n#清理临时图片\nrm /tmp/\"Icon.png\" /tmp/\"icon_mark.png\" /tmp/\"info_mark.png\" /tmp/\"mark.png\" /tmp/\"new_2xicon.png\" /tmp/\"new_3xicon.png\";\n\nfi\n\n#自动增加Build版本号\nPOS\nITION=(${#BUILD_DIR})\n    ((POSITION=POSITION-17))\n    TAIL=${BUILD_DIR:$POSITION}\n    echo \"tail is $TAIL\"\n    \n    ARCHIVE_TAIL=\"BuildProductsPath\"\n    \n    if [[ $TAIL = $ARCHIVE_TAIL ]];then\n    ((BUILD=BUILD+1))\n    echo \"new build is $BUILD($PROJ_PLIST}\"\n    /usr/libexec/PlistBuddy -c \"Set:CFBundleVersion $BUILD\" $PROJ_PLIST\n    fi";
		};
